import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

    container: {
        width: 200,
        height: 200,
        backgroundColor: 'white',
        overflow: 'hidden',
      },
      innerShadow: {
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        shadowColor: 'black',
        shadowOffset: { width: 0, height: 0 },
        shadowOpacity: 1,
        shadowRadius: 10,
        backgroundColor: 'transparent',
      },
      content: {
        flex: 1,
        backgroundColor: 'white',
        margin: 10,
      },
    
  
  
  });

  export default styles;
